create schema company_sales;
use company_sales;

-- creating customer table
create table customer (
	custmer_id INT not null auto_increment,
	firs_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	birth_date DATE,
	gender VARCHAR(50),
    primary key (custmer_id)
    
);
-- inserting data

-- reviwing customer table
select *
from customer;

-- creating store table
create table store (
	store_id INT not null auto_increment,
	city VARCHAR(50),
    primary key (store_id)
);
-- inserting data

-- reviwing store table
select *
from store;

-- creating employee table
create table employee (
	employee_id INT not null auto_increment,
	firs_name VARCHAR(50),
	last_nam VARCHAR(50),
	store_id INT,
	birth_date DATE,
    primary key (employee_id),
    constraint fk_emp_id 
    foreign key (store_id) references store (store_id)
);
-- inserting data

-- reviwing employee table
select *
from employee;

-- creating product table
create table product (
	product_id INT not null auto_increment,
	product_name VARCHAR(15),
	price DECIMAL(4,2),
    primary key (product_id)
);
-- inserting data

-- reviwing employee table
select *
from product;

-- creating orderss table
create table orders (
	order_id INT not null auto_increment,
	customer_id INT,
	product_id INT,
	quantity INT,
	unit_price DECIMAL(4,2),
	total_price DECIMAL(10,2),
	order_date DATE,
	employee_id INT,
    primary key (order_id),
    constraint fk_cust_id 
    foreign key (customer_id) references customer (custmer_id),
    constraint fk_prod_id 
    foreign key (product_id) references product (product_id),
    constraint fk_employee_id 
    foreign key (employee_id) references employee (employee_id)
    
);
-- inserting data

-- reviwing orders table
select *
from orders;